import React, { Component } from "react";

class LatestArticle extends Component {
  state = {};
  render() {
    return (
      <div>
        <span
          style={{ height: 50, width: 50, backgroundColor: "black" }}
        ></span>
      </div>
    );
  }
}

export default LatestArticle;
